import { useState } from "react";

export const NewContact = () => {
  return (
    <form action="/insert-contact" method="post">
      <p>
        <input type="text" name="name" placeholer="title" />
      </p>
      <p>
        <input type="text" name="birthday" placeholer="birthday" />
      </p>
      <p>
        <input type="text" name="description" placeholer="description" />
      </p>
      <button type="submit">연락처 추가</button>
    </form>
  );
};
